package basicStruct;

public class StrStrTuple {
	private String s1;

	private String s2;

	public StrStrTuple() {
		super();
		// TODO Auto-generated constructor stub
	}

	public StrStrTuple(String s1, String s2) {
		super();
		this.s1 = s1;
		this.s2 = s2;
	}

	public String getS1() {
		return s1;
	}

	public String getS2() {
		return s2;
	}

	public void setS1(String s1) {
		this.s1 = s1;
	}

	public void setS2(String s2) {
		this.s2 = s2;
	}

}